import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {
  constructor() {
    super();

    this.state = {
      string_cumle: 'Hello Basar'
    }

    function asd() {this.setState({ string_cumle: 'Naber Bro'})}
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            {this.state.string_cumle}
          </p>
            <button onClick = {App.asd()}>Change Text</button>
        </header>
      </div>
    );
  }
}

export default App;
